import React from 'react';
import brain from './brain.png';
import Tilt from 'react-tilt'
import './'

const Logo = () =>{
    return(
        <div>
            <Tilt className="Tilt" options={{ max : 25 }} style={{ height: 250, width: 250 }} >
                <div className="Tilt-inner">
                    <img src={brain} alt="logo" />
                </div>
            </Tilt>
        </div>
    );
}
export default Logo;
